import { Booklist } from "./components/Booklist";

//Appが親、Booklistが
const App = () => {
  const languages = ["React", "Vue", "Angular"];
  return (
    <>
      <h1>react app</h1>
      <Booklist language={languages[0]} />
      <Booklist />
      <Booklist />
      <Booklist />
    </>
  );
};
export default App;
